import React from "react";
import { Link } from "react-router-dom";
import "./Navbar.css";

const Navbar = () => {
  return (
    <div className="Navbar">
      <ul className="nav-menu" style={{ cursor: "pointer" }}>
        <li><Link style={{color:"white",fontSize:"50px"}}to="/">Home</Link></li>
        <li><Link style={{color:"white",fontSize:"50px"}}to="/about">About Me</Link></li>
        <li><Link style={{color:"white",fontSize:"50px"}}to="/services">Services</Link></li>
        <li><Link style={{color:"white",fontSize:"50px"}}to="/work">Portfolio</Link></li>
        <li><Link style={{color:"white",fontSize:"50px"}}to="/contact">Contact</Link></li>
      </ul>
      <div className="nav-connect">Connect With Me</div>
    </div>
  );
};

export default Navbar;
